start_filament_gcode:
"; Filament gcode
{if nozzle_diameter[initial_extruder] == 0.6}{local pressure_advance = 0.0}
{elsif nozzle_diameter[initial_extruder] == 0.4}{local pressure_advance = 0.0}
{elsif nozzle_diameter[initial_extruder] == 0.8}{local pressure_advance = 0.0}
{elsif nozzle_diameter[initial_extruder] == 1.0}{local pressure_advance = 0.0}
{endif}
{if printer_notes=~/.*DUPLICATOR_MODE.*/}
M572 D0:1 S{pressure_advance}
{else}
M572 D{current_extruder} S{pressure_advance}
{endif}"
